import { Link } from 'react-router-dom';

const StudentMenu = () => (
  <div className="flex gap-4 text-indigo-700 font-medium">
    <Link to="/dashboard/student" className="hover:text-purple-600">หน้าหลัก</Link>
    <Link to="/student/status" className="hover:text-purple-600">สถานะ</Link>
    <Link to="/student/profile" className="hover:text-purple-600">โปรไฟล์</Link>
  </div>
);

export default StudentMenu;
